select *
from credits c
outer apply
(
    select top 1
        cb.DateCalculation
        ,cb.Amount as AmountDebt
        ,cb.PercentAmount as PercentAmountDebt
        ,cb.CommisionAmount as CommisionAmountDebt
        ,cb.PenaltyAmount as PenaltyAmountDebt
        ,cb.LongPrice as LongPriceDebt
        ,cb.TransactionCosts as TransactionCostsDebt
    from dbo.CreditBalances cb
    where cb.creditid = c.creditid
    order by cb.DateCalculation desc
) cb
outer apply
(
    select
        sum(cp.Amount) as AmountPaid
        ,sum(cp.PercentAmount) as PercentAmountPaid
        ,sum(cp.CommissionAmount) as CommisionAmountPaid
        ,sum(cp.PenaltyAmount) as PenaltyAmountPaid
        ,sum(cp.LongPrice) as LongPricePaid
        ,sum(cp.TransactionCosts) as TransactionCostsPaid
    from dbo.CreditPayments cp
    where cp.creditid = c.creditid
        and cp.DateCreated > cb.DateCalculation
) cp
    
